🚴‍♀️ Este pequeño sufrió una fuerte caída de cara al pavimento andando en bicicleta. 

✅Primero que todo, al igual que frente a cualquier urgencia, intentar mantener la calma. La zona de la boca está muy irrigada por lo tanto muchas veces un trauma en los dientes va acompañado de alguna herida en labios, lengua o mejillas, zonas que sangran mucho e impide ver cuál es el o los dientes afectados. De manera que lo indicado es intentar limpiar la sangre de la zona con solución fisiológica, si la tiene disponible, o en su defecto agua de la llave, luego identificar la o las zonas del tejido blando desde donde sangra  y comprimir por 2 minutos. Asista al centro médico más cercano y a su Odontopediatra de confianza para que evalúe posibles traumas dentoalveolares o lesiones en cavidad bucal. 🦷

